import React from 'react';
import LiquidGauge from 'react-liquid-gauge';

function Skills() {
  const skillsData = [
    { label: "HTML", value: 80, circleColor: "#4CAF50", waveColor: "#45a049" },
    { label: "Skill2", value: 80, circleColor: "#2196F3", waveColor: "#1976D2" },
    { label: "Skill3", value: 80, circleColor: "#FF9800", waveColor: "#FF5722" },
    { label: "Skill4", value: 80, circleColor: "#9C27B0", waveColor: "#673AB7" },
    { label: "Skill5", value: 85, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "Skill5", value: 95, circleColor: "#FF5722", waveColor: "#E64A19" },
  ];

  return (
    <div className="container-fluid software-skills-container-fluid">
      <div className="container">
        <h1>Skills</h1>
		<div className="row">
          {skillsData.map((skill, index) => (
              <div className="col-md-2"><div key={index} style={{marginBottom: '20px' }}>
                <LiquidGauge
                  width={120}
                  height={120}
                  value={skill.value}
                  label={skill.label}
                  circleColor={skill.circleColor}
                  waveColor={skill.waveColor}
                />
                
              </div>
               </div>
            ))}
         
          <div className="col-md-6">
            {/* Add more skills or content in the second column if needed */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Skills;
